Insert into HOSPITAL.LABTEST (LABTESTID,TESTNAME,TESTDESCRIPTION,TESTPRICE) values ('L001','CT scan','A CT scan is a medical imaging procedure that uses computer-processed combinations of many X-ray measurements taken from different angles to produce cross-sectional (tomographic) images (virtual "slices") of specific areas of a scanned object, allowing the user to see inside the object without cutting.',199);
Insert into HOSPITAL.LABTEST (LABTESTID,TESTNAME,TESTDESCRIPTION,TESTPRICE) values ('L002','MRI','Magnetic resonance imaging (MRI) is a medical imaging technique used to produce high-quality images of the inside of the body. MRI uses a strong magnetic field and radio waves to produce detailed images of the organs and tissues in the body.',159);
Insert into HOSPITAL.LABTEST (LABTESTID,TESTNAME,TESTDESCRIPTION,TESTPRICE) values ('L003','X-ray','X-rays are a type of electromagnetic radiation with a wavelength in the range of 0.0110 nanometers, corresponding to frequencies in the range 30 petahertz to 30 exahertz (3×1027 Hz to 3×1033 Hz).',119);
Insert into HOSPITAL.LABTEST (LABTESTID,TESTNAME,TESTDESCRIPTION,TESTPRICE) values ('L004','blood tests','A blood test is a laboratory analysis performed on a blood sample that is usually extracted from a vein in the arm using a needle, or via finger-prick.',99);
Insert into HOSPITAL.LABTEST (LABTESTID,TESTNAME,TESTDESCRIPTION,TESTPRICE) values ('L005','urine tests','A urine test is a test that is performed on a urine sample to analyze it for various compounds and markers.',69);
Insert into HOSPITAL.LABTEST (LABTESTID,TESTNAME,TESTDESCRIPTION,TESTPRICE) values ('L006','biopsy','A biopsy is a medical procedure in which a small sample of tissue is removed from the body for examination under a microscope.',129);
Insert into HOSPITAL.LABTEST (LABTESTID,TESTNAME,TESTDESCRIPTION,TESTPRICE) values ('L007','Complete blood count (CBC)','A complete blood count (CBC) is a blood test used to evaluate your overall health and detect a wide range of disorders, including anemia, infection and leukemia. A complete blood count test measures many of the cells in your blood, including red blood cells, white blood cells and platelets.',99);
Insert into HOSPITAL.LABTEST (LABTESTID,TESTNAME,TESTDESCRIPTION,TESTPRICE) values ('L008','Comprehensive metabolic panel (CMP)','A comprehensive metabolic panel (CMP) is a blood test that gives your doctor a detailed look at your body''s chemical balance and metabolism. This test can show how well your kidneys and liver are working and whether these organs are affected by diabetes or other conditions.',159);
Insert into HOSPITAL.LABTEST (LABTESTID,TESTNAME,TESTDESCRIPTION,TESTPRICE) values ('L009','Lipid panel','A lipid panel is a medical test that measures the levels of lipids in the blood. These include cholesterol, triglycerides, low-density lipoprotein (LDL) cholesterol, and high-density lipoprotein (HDL) cholesterol.',159);
Insert into HOSPITAL.LABTEST (LABTESTID,TESTNAME,TESTDESCRIPTION,TESTPRICE) values ('L010','Thyroid function tests','Thyroid function tests are a series of blood tests used to evaluate the function of the thyroid gland. The tests measure the levels of thyroid hormones in the blood and can help to diagnose thyroid disorders.',159);
Insert into HOSPITAL.LABTEST (LABTESTID,TESTNAME,TESTDESCRIPTION,TESTPRICE) values ('L011','Liver function tests','Liver function tests (LFTs) are blood tests used to assess the health of the liver. LFTs can be used to screen for liver problems, to diagnose known liver conditions, and to monitor the liver''s health during and after treatment.',179);
Insert into HOSPITAL.LABTEST (LABTESTID,TESTNAME,TESTDESCRIPTION,TESTPRICE) values ('L012','Kidney function tests','Kidney function tests are a group of tests that are performed together to determine how well the kidneys are functioning. The tests measure the levels of certain substances in the blood and urine, and they may also involve imaging studies.',199);
Insert into HOSPITAL.LABTEST (LABTESTID,TESTNAME,TESTDESCRIPTION,TESTPRICE) values ('L013','Pregnancy test','A pregnancy test is a medical test that is used to determine if a woman is pregnant.',109);
Insert into HOSPITAL.LABTEST (LABTESTID,TESTNAME,TESTDESCRIPTION,TESTPRICE) values ('L014','HIV test','A test used to determine whether a person has been infected with the human immunodeficiency virus (HIV). There are several types of HIV tests, including the ELISA test, the Western blot test, and the polymerase chain reaction (PCR) test.',159);
Insert into HOSPITAL.LABTEST (LABTESTID,TESTNAME,TESTDESCRIPTION,TESTPRICE) values ('L015','Drug test','A drug test is a technical analysis of a biological specimen, for example urine, hair, blood, breath, sweat, or oral fluid / saliva  to determine the presence or absence of specified parent drugs or their metabolites.',99);
