Insert into HOSPITAL.SPECIALIZATION (SID,SNAME,DESCRIPTION,DEPTID) values ('S001','Allergists/Immunologists','They treat immune system disorders such as asthma, eczema, food allergies, insect sting allergies, and some autoimmune diseases.','D001');
Insert into HOSPITAL.SPECIALIZATION (SID,SNAME,DESCRIPTION,DEPTID) values ('S002','Anesthesiologists','These doctors give you drugs to numb your pain or to put you under during surgery, childbirth, or other procedures. They monitor your vital signs while youre under anesthesia.','D002');
Insert into HOSPITAL.SPECIALIZATION (SID,SNAME,DESCRIPTION,DEPTID) values ('S003','Cardiologists','Theyre experts on the heart and blood vessels. You might see them for heart failure, a heart attack, high blood pressure, or an irregular heartbeat.','D003');
Insert into HOSPITAL.SPECIALIZATION (SID,SNAME,DESCRIPTION,DEPTID) values ('S004','Colon and Rectal Surgeons','You would see these doctors for problems with your small intestine, colon, and bottom. They can treat colon cancer, hemorrhoids, and inflammatory bowel disease. ','D024');
Insert into HOSPITAL.SPECIALIZATION (SID,SNAME,DESCRIPTION,DEPTID) values ('S005','Critical Care Medicine Specialists','They care for people who are critically ill or injured, often heading intensive care units in hospitals. You might see them if your heart or other organs are failing or if youve been in an accident. ','D025');
Insert into HOSPITAL.SPECIALIZATION (SID,SNAME,DESCRIPTION,DEPTID) values ('S006','Dermatologists','Have problems with your skin, hair, nails? Do you have moles, scars, acne, or skin allergies? Dermatologists can help.','D004');
Insert into HOSPITAL.SPECIALIZATION (SID,SNAME,DESCRIPTION,DEPTID) values ('S007','Endocrinologists','These are experts on hormones and metabolism. They can treat conditions like diabetes, thyroid problems, infertility, and calcium and bone disorders.','D005');
Insert into HOSPITAL.SPECIALIZATION (SID,SNAME,DESCRIPTION,DEPTID) values ('S008','Emergency Medicine Specialists','These doctors make life-or-death decisions for sick and injured people, usually in an emergency room. Their job is to save lives and to avoid or lower the chances of disability.','D025');
Insert into HOSPITAL.SPECIALIZATION (SID,SNAME,DESCRIPTION,DEPTID) values ('S009','Family Physicians','They care for the whole family, including children, adults, and the elderly. They do routine checkups and screening tests, give you flu and immunization shots, and manage diabetes and other ongoing medical conditions.','D025');
Insert into HOSPITAL.SPECIALIZATION (SID,SNAME,DESCRIPTION,DEPTID) values ('S010','Gastroenterologists','Theyre specialists in digestive organs, including the stomach, bowels, pancreas, liver, and gallbladder. You might see them for abdominal pain, ulcers, diarrhea, jaundice, or cancers in your digestive organs. They also do a colonoscopy and other tests for colon cancer.','D006');
Insert into HOSPITAL.SPECIALIZATION (SID,SNAME,DESCRIPTION,DEPTID) values ('S011','Geriatric Medicine Specialists','These doctors care for the elderly. They can treat people in their homes, doctors'' offices, nursing homes, assisted-living centers, and hospitals.','D025');
Insert into HOSPITAL.SPECIALIZATION (SID,SNAME,DESCRIPTION,DEPTID) values ('S012','Hematologists','These are specialists in diseases of the blood, spleen, and lymph glands, like sickle cell disease, anemia, hemophilia, and leukemia.','D007');
Insert into HOSPITAL.SPECIALIZATION (SID,SNAME,DESCRIPTION,DEPTID) values ('S013','Hospice and Palliative Medicine Specialists','They work with people who are nearing death. Theyre experts in pain management. They work with a team of other doctors to keep up your quality of life.','D025');
Insert into HOSPITAL.SPECIALIZATION (SID,SNAME,DESCRIPTION,DEPTID) values ('S014','Infectious Disease Specialists','They diagnose and treat infections in any part of your body, like fevers, Lyme disease, pneumonia, tuberculosis, and HIV and AIDS. Some of them specialize in preventive medicine or travel medicine.','D025');
Insert into HOSPITAL.SPECIALIZATION (SID,SNAME,DESCRIPTION,DEPTID) values ('S015','Internists','These primary-care doctors treat both common and complex illnesses, usually only in adults. Youll likely visit them or your family doctor first for any condition. Internists often have advanced training in a host of subspecialties, like heart disease, cancer, or adolescent or sleep medicine. With additional training (called a fellowship), internists can specialize in cardiology, gastroenterology, endocrinology, nephrology, pulmonology, and other medical sub-specialties.','D025');
Insert into HOSPITAL.SPECIALIZATION (SID,SNAME,DESCRIPTION,DEPTID) values ('S016','Medical Geneticists','They diagnose and treat hereditary disorders passed down from parents to children. These doctors may also offer genetic counseling and screening tests.','D025');
Insert into HOSPITAL.SPECIALIZATION (SID,SNAME,DESCRIPTION,DEPTID) values ('S017','Nephrologists','They treat kidney diseases as well as high blood pressure and fluid and mineral imbalances linked to kidney disease.','D008');
Insert into HOSPITAL.SPECIALIZATION (SID,SNAME,DESCRIPTION,DEPTID) values ('S018','Neurologists','These are specialists in the nervous system, which includes the brain, spinal cord, and nerves. They treat strokes, brain and spinal tumors, epilepsy, Parkinson''s disease, and Alzheimer''s disease.','D009');
Insert into HOSPITAL.SPECIALIZATION (SID,SNAME,DESCRIPTION,DEPTID) values ('S019','Obstetricians and Gynecologists','Often called OB/GYNs, these doctors focus on women''s health, including pregnancy and childbirth. They do Pap smears, pelvic exams, and pregnancy checkups. OB/GYNs are trained in both areas. But some of them may focus on women''s reproductive health (gynecologists), and others specialize in caring for pregnant women (obstetricians).','D010');
Insert into HOSPITAL.SPECIALIZATION (SID,SNAME,DESCRIPTION,DEPTID) values ('S020','Oncologists','These internists are cancer specialists. They do chemotherapy treatments and often work with radiation oncologists and surgeons to care for someone with cancer.','D011');
Insert into HOSPITAL.SPECIALIZATION (SID,SNAME,DESCRIPTION,DEPTID) values ('S021','Ophthalmologists','You call them eye doctors. They can prescribe glasses or contact lenses and diagnose and treat diseases like glaucoma. Unlike optometrists, theyre medical doctors who can treat every kind of eye condition as well as operate on the eyes.','D012');
Insert into HOSPITAL.SPECIALIZATION (SID,SNAME,DESCRIPTION,DEPTID) values ('S022','Osteopaths','Doctors of osteopathic medicine (DO) are fully licensed medical doctors just like MDs. Their training stresses a whole body approach. Osteopaths use the latest medical technology but also the bodys natural ability to heal itself.','D013');
Insert into HOSPITAL.SPECIALIZATION (SID,SNAME,DESCRIPTION,DEPTID) values ('S023','Otolaryngologists','They treat diseases in the ears, nose, throat, sinuses, head, neck, and respiratory system. They also can do reconstructive and plastic surgery on your head and neck.','D014');
Insert into HOSPITAL.SPECIALIZATION (SID,SNAME,DESCRIPTION,DEPTID) values ('S024','Pathologists','These lab doctors identify the causes of diseases by examining body tissues and fluids under microscopes.','D015');
Insert into HOSPITAL.SPECIALIZATION (SID,SNAME,DESCRIPTION,DEPTID) values ('S025','Pediatricians','They care for children from birth to young adulthood. Some pediatricians specialize in pre-teens and teens, child abuse, or children''s developmental issues.','D016');
Insert into HOSPITAL.SPECIALIZATION (SID,SNAME,DESCRIPTION,DEPTID) values ('S026','Physiatrists','These specialists in physical medicine and rehabilitation treat neck or back pain and sports or spinal cord injuries as well as other disabilities caused by accidents or diseases.','D017');
Insert into HOSPITAL.SPECIALIZATION (SID,SNAME,DESCRIPTION,DEPTID) values ('S027','Plastic Surgeons','You might call them cosmetic surgeons. They rebuild or repair your skin, face, hands, breasts, or body. That can happen after an injury or disease or for cosmetic reasons.','D024');
Insert into HOSPITAL.SPECIALIZATION (SID,SNAME,DESCRIPTION,DEPTID) values ('S028','Podiatrists','They care for problems in your ankles and feet. That can include injuries from accidents or sports or from ongoing health conditions like diabetes. Some podiatrists have advanced training in other subspecialties of the foot.','D018');
Insert into HOSPITAL.SPECIALIZATION (SID,SNAME,DESCRIPTION,DEPTID) values ('S029','Preventive Medicine Specialists','They focus on keeping you well. They may work in public health or at hospitals. Some focus on treating people with addictions, illnesses from exposure to drugs, chemicals, and poisons, and other areas.','D025');
Insert into HOSPITAL.SPECIALIZATION (SID,SNAME,DESCRIPTION,DEPTID) values ('S030','Psychiatrists','These doctors work with people with mental, emotional, or addictive disorders. They can diagnose and treat depression, schizophrenia, substance abuse, anxiety disorders, and sexual and gender identity issues. Some psychiatrists focus on children, adolescents, or the elderly.','D019');
Insert into HOSPITAL.SPECIALIZATION (SID,SNAME,DESCRIPTION,DEPTID) values ('S031','Pulmonologists','You would see these specialists for problems like lung cancer, pneumonia, asthma, emphysema, and trouble sleeping caused by breathing issues.','D020');
Insert into HOSPITAL.SPECIALIZATION (SID,SNAME,DESCRIPTION,DEPTID) values ('S032','Radiologists','They use X-rays, ultrasound, and other imaging tests to diagnose diseases. They can also specialize in radiation oncology to treat conditions like cancer.','D021');
Insert into HOSPITAL.SPECIALIZATION (SID,SNAME,DESCRIPTION,DEPTID) values ('S033','Rheumatologists','They specialize in arthritis and other diseases in your joints, muscles, bones, and tendons. You might see them for your osteoporosis (weak bones), back pain, gout, tendinitis from sports or repetitive injuries, and fibromyalgia.','D022');
Insert into HOSPITAL.SPECIALIZATION (SID,SNAME,DESCRIPTION,DEPTID) values ('S034','Sleep Medicine Specialists','They find and treat causes behind your poor sleep. They may have sleep labs or give you take-home tests to chart your sleep-wake patterns.','D025');
Insert into HOSPITAL.SPECIALIZATION (SID,SNAME,DESCRIPTION,DEPTID) values ('S035','Sports Medicine Specialists','These doctors diagnose, treat, and prevent injuries related to sports and exercise.','D025');
Insert into HOSPITAL.SPECIALIZATION (SID,SNAME,DESCRIPTION,DEPTID) values ('S036','General Surgeons','These doctors can operate on all parts of your body. They can take out tumors, appendices, or gallbladders and repair hernias. Many surgeons have subspecialties, like cancer, hand, or vascular surgery.','D024');
Insert into HOSPITAL.SPECIALIZATION (SID,SNAME,DESCRIPTION,DEPTID) values ('S037','Urologists','These are surgeons who care for men and women for problems in the urinary tract, like a leaky bladder. They also treat male infertility and do prostate exams.','D023');
